import React from 'react';
import './FooterCTA.css';

const FooterCTA = ({ theme }) => {
  const getCTAText = () => {
    switch (theme) {
      case 'Mafia':
        return 'Make Us an Offer';
      case 'Drug Game':
        return 'Get Your Supply';
      case 'Adult Entertainment':
        return 'Keep Them Coming Back';
      case 'Monopoly':
        return 'Control the Board';
      case 'Foodie Influencer':
        return 'Get Your Digital Feast';
      case 'Social Media Influencer':
        return 'Boost Your Brand';
      default:
        return 'Get Started Today';
    }
  };

  return (
    <section
      className={`footer-cta ${theme.toLowerCase()}`}
      data-aos="fade-up"
    >
      <h2>{getCTAText()}</h2>
      <button>Contact Us</button>
    </section>
  );
};

export default FooterCTA;
